import React from 'react';
import Bootstrap from '../assets/images/database/img_bootstrap.png';
import Fontawesome from '../assets/images/database/img_fontawesome.png';
import Jquery from '../assets/images/database/img_jquery.png';
import Redux from '../assets/images/database/img_redux.png';

export const LibraryList = [
    {   
        id:"1",
        name:"Bootstrap",
        source:Bootstrap,
        url:"https://getbootstrap.com/",
    },
    {   
        id:"2",
        name:"Fontawesome",
        source:Fontawesome,
        url:"https://fontawesome.com/",
    },
    {   
        id:"3",
        name:"jQuery",
        source:Jquery,
        url:"https://jquery.com/",
    },
    {   
        id:"4",
        name:"Redux",
        source:Redux,
        url:"https://redux.js.org/",
    },
]
